import './App.css';
import Header from './Header';
import Post from './Post';
import { Routes, Route } from 'react-router-dom'
import Layout from './Layout';


function App() {
  return (
    <Routes>
      <Route path='/' element={<Layout />}>

      <Route index element={
        <Post />
      }/>

      <Route path={'/login'} element={
            <div>Login page</div>
      } />

      </Route>

    </Routes>

  );
}

export default App;
